import { StyleSheet } from 'react-native'

const styles = StyleSheet.create({
    inscription: {
        alignSelf: 'stretch',
        backgroundColor: '#73B479'
    },
    header: {
        fontSize: 24,
        color: '#fff',
        paddingBottom: 10,
        marginBottom: 40
    },
    textinput: {
        height: 40,
        width: '70%',
        marginBottom: 30,
        color: '#fff',
        borderBottomColor: '#f8f8f8',
        borderBottomWidth: 1,
        placeholderTextColor: 'white',
        margin: 'auto'
    },
    button: {
        alignSelf: 'stretch',
        alignItems: 'center',
        padding: 20,
        backgroundColor: '#59cbbd',
        marginTop: 30
    }, 
    btntext: {
        color: '#fff',
        fondWeignt: 'bold'
    }
})

export default styles
